<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <script>
        //Variables to hold mouse coordinates on main page and svg canvas
        var cX; //X mouse position on canvas
        var cY; //Y mouse position on canvas
        var curX; //X coordinate of canvas (top left)
        var curY; //Y coordinate of canvas (top left)

        //Tracks mouse movement
        var isIE = document.all ? true : false;
        if (!isIE) document.captureEvents(Event.MOUSEMOVE);
        document.onmousemove = function (mp) {
            var x;
            var y;
            if (!isIE) {
                x = mp.pageX;
                y = mp.pageY;
            }
            if (isIE) {
                x = event.clientX + document.body.scrollLeft;
                y = event.clientY + document.body.scrollTop;
            }

            cX = x;
            cY = y;

            var elem = document.getElementById("ev");
            elem.innerHTML = cX + ", " + cY;
        }

        //Add updateSvgCoordinates to onload and onresize
        window.onload = updateSvgCoordinates;
        window.onresize = updateSvgCoordinates;

        //function captures x,y coordinates of the svg element
        //Adapted from code provided by http://www.quirksmode.org/js/findpos.html
        function updateSvgCoordinates() {
            var obj = document.getElementById("svgDoc");
            curX = curY = 0;
            if (obj.offsetParent) {
                do {
                    curX += obj.offsetLeft;
                    curY += obj.offsetTop;
                } while (obj = obj.offsetParent);
            }

            x = document.getElementById("svgId");
            x.innerHTML = curX + ", " + curY;
        }

        //event registered onmousemove on the svg element
        function svgCanvasMouseCoords(evt) {
            var localX = cX - curX;
            var localY = cY - curY;
            x = document.getElementById("xy");
            x.innerHTML = localX + ", " + localY;
        }

        function svgClickCoords() {
            var localX = cX - curX;
            var localY = cY - curY;

            window.opener.document.getElementById("myXY").innerText = 'x: ' + localX + ', y: ' + localY;
            window.close();

        }

    </script>
</head>
